import React, { useState } from 'react';
import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  StyleSheet,
  SafeAreaView,
  Alert,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { useTheme } from '../context/ThemeContext';

const DocumentsScreen = ({ navigation }) => {
  const theme = useTheme();
  const [selectedCategory, setSelectedCategory] = useState('all');

  const categories = [
    { key: 'all', label: 'All', icon: 'üìÅ', count: 12 },
    { key: 'identity', label: 'Identity', icon: 'üÜî', count: 3 },
    { key: 'address', label: 'Address', icon: 'üè†', count: 4 },
    { key: 'financial', label: 'Financial', icon: 'üí∞', count: 3 },
    { key: 'other', label: 'Other', icon: 'üìÑ', count: 2 },
  ];

  const documents = [
    {
      id: 1,
      name: 'Aadhaar Card',
      category: 'identity',
      type: 'PDF',
      size: '2.4 MB',
      uploadedDate: '2024-02-15',
      icon: 'üÜî',
    },
    {
      id: 2,
      name: 'PAN Card',
      category: 'identity',
      type: 'PDF',
      size: '1.8 MB',
      uploadedDate: '2024-02-15',
      icon: 'üÜî',
    },
    {
      id: 3,
      name: 'Electricity Bill',
      category: 'address',
      type: 'PDF',
      size: '3.2 MB',
      uploadedDate: '2024-02-14',
      icon: '‚ö°',
    },
    {
      id: 4,
      name: 'Bank Statement',
      category: 'financial',
      type: 'PDF',
      size: '4.5 MB',
      uploadedDate: '2024-02-10',
      icon: 'üè¶',
    },
    {
      id: 5,
      name: 'Ration Card',
      category: 'address',
      type: 'PDF',
      size: '2.1 MB',
      uploadedDate: '2024-02-08',
      icon: 'üè†',
    },
  ];

  const filteredDocuments = documents.filter(
    doc => selectedCategory === 'all' || doc.category === selectedCategory
  );

  const handleUploadDocument = () => {
    Alert.alert(
      'Upload Document',
      'Choose upload method',
      [
        { text: 'Take Photo', onPress: () => {} },
        { text: 'Choose from Gallery', onPress: () => {} },
        { text: 'Cancel', style: 'cancel' },
      ]
    );
  };

  const handleDocumentAction = (doc) => {
    Alert.alert(
      doc.name,
      'Choose an action',
      [
        { text: 'View', onPress: () => {} },
        { text: 'Download', onPress: () => {} },
        { text: 'Delete', onPress: () => {}, style: 'destructive' },
        { text: 'Cancel', style: 'cancel' },
      ]
    );
  };

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <TouchableOpacity
          onPress={() => navigation.goBack()}
          style={styles.backButton}
        >
          <Text style={styles.backIcon}>‚Üê</Text>
        </TouchableOpacity>
        <View style={styles.headerContent}>
          <Text style={styles.headerTitle}>My Documents</Text>
          <Text style={styles.headerSubtitle}>{documents.length} documents</Text>
        </View>
        <TouchableOpacity
          onPress={handleUploadDocument}
          style={styles.uploadButton}
        >
          <Text style={styles.uploadIcon}>+</Text>
        </TouchableOpacity>
      </View>

      {/* Categories */}
      <ScrollView
        horizontal
        showsHorizontalScrollIndicator={false}
        style={styles.categoriesContainer}
        contentContainerStyle={styles.categoriesContent}
      >
        {categories.map((cat) => (
          <TouchableOpacity
            key={cat.key}
            onPress={() => setSelectedCategory(cat.key)}
            style={[
              styles.categoryChip,
              selectedCategory === cat.key && styles.categoryChipActive,
            ]}
          >
            <Text style={styles.categoryIcon}>{cat.icon}</Text>
            <Text
              style={[
                styles.categoryText,
                selectedCategory === cat.key && styles.categoryTextActive,
              ]}
            >
              {cat.label} ({cat.count})
            </Text>
          </TouchableOpacity>
        ))}
      </ScrollView>

      {/* Documents List */}
      <ScrollView showsVerticalScrollIndicator={false}>
        <View style={styles.documentsContainer}>
          {filteredDocuments.length === 0 ? (
            <View style={styles.emptyState}>
              <Text style={styles.emptyIcon}>üìÅ</Text>
              <Text style={styles.emptyTitle}>No Documents Found</Text>
              <Text style={styles.emptyText}>
                Upload your first document to get started
              </Text>
              <TouchableOpacity
                onPress={handleUploadDocument}
                style={styles.emptyButton}
              >
                <Text style={styles.emptyButtonText}>Upload Document</Text>
              </TouchableOpacity>
            </View>
          ) : (
            filteredDocuments.map((doc) => (
              <TouchableOpacity
                key={doc.id}
                onPress={() => handleDocumentAction(doc)}
                style={styles.documentCard}
                activeOpacity={0.7}
              >
                <View style={styles.documentIconContainer}>
                  <Text style={styles.documentIcon}>{doc.icon}</Text>
                </View>
                <View style={styles.documentContent}>
                  <Text style={styles.documentName}>{doc.name}</Text>
                  <View style={styles.documentMeta}>
                    <View style={styles.metaItem}>
                      <Text style={styles.metaIcon}>üìÑ</Text>
                      <Text style={styles.metaText}>{doc.type}</Text>
                    </View>
                    <View style={styles.metaItem}>
                      <Text style={styles.metaIcon}>üíæ</Text>
                      <Text style={styles.metaText}>{doc.size}</Text>
                    </View>
                    <View style={styles.metaItem}>
                      <Text style={styles.metaIcon}>üìÖ</Text>
                      <Text style={styles.metaText}>{doc.uploadedDate}</Text>
                    </View>
                  </View>
                </View>
                <View style={styles.documentArrow}>
                  <Text style={styles.arrowIcon}>‚ãÆ</Text>
                </View>
              </TouchableOpacity>
            ))
          )}
        </View>

        {/* Upload Banner */}
        <View style={styles.section}>
          <LinearGradient
            colors={['#3B82F6', '#2563EB']}
            start={{ x: 0, y: 0 }}
            end={{ x: 1, y: 1 }}
            style={styles.uploadBanner}
          >
            <Text style={styles.bannerIcon}>üì§</Text>
            <View style={styles.bannerContent}>
              <Text style={styles.bannerTitle}>Upload More Documents</Text>
              <Text style={styles.bannerText}>
                Keep all your important documents in one place
              </Text>
            </View>
            <TouchableOpacity
              onPress={handleUploadDocument}
              style={styles.bannerButton}
            >
              <Text style={styles.bannerButtonText}>Upload</Text>
            </TouchableOpacity>
          </LinearGradient>
        </View>

        <View style={{ height: 40 }} />
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F8FAFC',
  },
  header: {
    flexDirection: 'row',
    alignItems: 'center',
    paddingHorizontal: 20,
    paddingVertical: 16,
    backgroundColor: '#FFFFFF',
    borderBottomWidth: 1,
    borderBottomColor: '#E2E8F0',
  },
  backButton: {
    marginRight: 12,
  },
  backIcon: {
    fontSize: 24,
    color: '#1E293B',
  },
  headerContent: {
    flex: 1,
  },
  headerTitle: {
    fontSize: 20,
    fontWeight: '700',
    color: '#1E293B',
  },
  headerSubtitle: {
    fontSize: 12,
    color: '#64748B',
    marginTop: 2,
  },
  uploadButton: {
    width: 40,
    height: 40,
    borderRadius: 12,
    backgroundColor: '#2563EB',
    alignItems: 'center',
    justifyContent: 'center',
  },
  uploadIcon: {
    fontSize: 24,
    color: '#FFFFFF',
    fontWeight: '700',
  },
  categoriesContainer: {
    backgroundColor: '#FFFFFF',
    borderBottomWidth: 1,
    borderBottomColor: '#E2E8F0',
  },
  categoriesContent: {
    paddingHorizontal: 20,
    paddingVertical: 12,
  },
  categoryChip: {
    flexDirection: 'row',
    alignItems: 'center',
    paddingHorizontal: 16,
    paddingVertical: 8,
    borderRadius: 20,
    backgroundColor: '#F8FAFC',
    marginRight: 8,
    borderWidth: 1,
    borderColor: '#E2E8F0',
  },
  categoryChipActive: {
    backgroundColor: '#2563EB',
    borderColor: '#2563EB',
  },
  categoryIcon: {
    fontSize: 16,
    marginRight: 6,
  },
  categoryText: {
    fontSize: 14,
    fontWeight: '600',
    color: '#64748B',
  },
